// src/components/Home.js
import React, { useState, useEffect } from 'react';
import { getDashboardData, getDashboardModelsData, getAuditLogs } from '../api';

function Home() {
  const [dashboardData, setDashboardData] = useState(null);
  const [modelsData, setModelsData] = useState(null);
  const [auditLogs, setAuditLogs] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        const [dashboardResponse, modelsResponse, logsResponse] = await Promise.all([
          getDashboardData(),
          getDashboardModelsData(),
          getAuditLogs({ page_size: 10 }) // Get last 10 logs
        ]);

        setDashboardData(dashboardResponse.data);
        setModelsData(modelsResponse.data);
        setAuditLogs(logsResponse.data.results || logsResponse.data);
      } catch (err) {
        setError('Error al cargar los datos del dashboard');
        console.error('Dashboard error:', err);
      } finally {
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  if (loading) {
    return (
      <div className="min-h-full flex items-center justify-center">
        <div className="text-lg">Cargando dashboard...</div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="min-h-full flex items-center justify-center">
        <div className="text-red-600">{error}</div>
      </div>
    );
  }

  return (
    <div className="min-h-full p-6 bg-gray-50">
      <h1 className="text-3xl font-bold text-gray-800 mb-6">Dashboard ITAM</h1>

      <div className="flex gap-6">
        {/* Sección 1: Tabla de tipos de activos por región */}
        <div className="bg-white rounded-lg shadow-md p-6 flex-1">
          <h2 className="text-xl font-semibold text-gray-700 mb-4">Distribución de Activos por Tipo y Región</h2>
          {dashboardData && dashboardData.tipos_activo.length > 0 ? (
            <div className="overflow-x-auto">
              <table className="min-w-full table-auto border-collapse border border-gray-300">
                <thead>
                  <tr className="bg-gray-100">
                    <th className="border border-gray-300 px-4 py-2 text-left">Tipo de Activo</th>
                    {dashboardData.regions.map(region => (
                      <th key={region} className="border border-gray-300 px-4 py-2 text-center">{region}</th>
                    ))}
                    <th className="border border-gray-300 px-4 py-2 text-center">Total</th>
                  </tr>
                </thead>
                <tbody>
                  {dashboardData.tipos_activo.map((tipo, index) => (
                    <tr key={tipo.name} className={index === dashboardData.tipos_activo.length - 1 ? 'bg-gray-200 font-bold' : 'hover:bg-gray-50'}>
                      <td className="border border-gray-300 px-4 py-2">{tipo.name}</td>
                      {dashboardData.regions.map(region => (
                        <td key={region} className="border border-gray-300 px-4 py-2 text-center">{tipo.counts[region] || 0}</td>
                      ))}
                      <td className="border border-gray-300 px-4 py-2 text-center">{tipo.total}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          ) : (
            <p className="text-gray-500">No hay datos disponibles</p>
          )}
        </div>

        {/* Sección 2: Placeholder */}
        <div className="bg-white rounded-lg shadow-md p-6 flex-1">
          <h2 className="text-xl font-semibold text-gray-700 mb-4">Sección 2</h2>
          <p className="text-gray-500">Contenido pendiente...</p>
        </div>

        {/* Sección 3: Placeholder */}
        <div className="bg-white rounded-lg shadow-md p-6 flex-1">
          <h2 className="text-xl font-semibold text-gray-700 mb-4">Sección 3</h2>
          <p className="text-gray-500">Contenido pendiente...</p>
        </div>
      </div>
    </div>
  );
}

export default Home;
